import React, { useRef, useEffect, useState } from "react";
import { Provider, Heading, Subhead } from "rebass";
import { Hero, Flex, CallToAction, ScrollDownIndicator } from "react-landing-page";
import { throttle } from "lodash";
import Home from "./Home";
import { motion } from "framer-motion";

const Landing = () => {
  const scrollToRef = useRef(null);
  const backgroundRef = useRef(null);
  const [isDarkMode, setIsDarkMode] = useState(true);

  const handleScroll = throttle(() => {
    const scrollY = window.scrollY || window.pageYOffset;
    if (backgroundRef.current) {
      backgroundRef.current.style.transform = `translate3d(0, ${scrollY * 0.4}px, 0)`;
    }
  }, 16);

  useEffect(() => {
    window.addEventListener("scroll", handleScroll);
    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, [handleScroll]);

  const handleClick = () => {
    if (scrollToRef.current) {
      scrollToRef.current.scrollIntoView({ behavior: "smooth" });
    }
  };

  const toggleTheme = () => {
    setIsDarkMode(!isDarkMode);
  };

  return (
    <>
      <Provider>
        <Hero
          color={isDarkMode ? "white" : "black"}
          bg={isDarkMode ? "black" : "white"}
          bgOpacity={0.1}
          minHeight="100vh"
          style={{ position: "relative" }}
        >
          {/* Dark/Light Mode Toggle Button */}
          <button
            onClick={toggleTheme}
            style={{
              position: "absolute",
              top: 20,
              right: 20,
              padding: "10px 20px",
              background: isDarkMode ? "white" : "black",
              color: isDarkMode ? "black" : "white",
              border: "none",
              borderRadius: "5px",
              cursor: "pointer",
            }}
          >
            {isDarkMode ? "Switch to Light Mode" : "Switch to Dark Mode"}
          </button>

          {/* Background Image with Parallax Effect */}
          <div
            style={{
              position: "absolute",
              top: 0,
              left: 0,
              width: "100%",
              height: "100%",
              overflow: "hidden",
              zIndex: "-1",
            }}
            ref={backgroundRef}
          >
            <img
              src="https://wallpapers.com/images/high/verdant-rice-fields-and-farm-surrounding-small-village-8uuv5wg8j0tqwpo5.webp"
              alt="Lush green rice fields surrounding a village"
              style={{ width: "100%", height: "100%", objectFit: "cover" }}
              loading="lazy"
            />
            <div
              style={{
                position: "absolute",
                top: 0,
                left: 0,
                width: "100%",
                height: "100%",
                background: "linear-gradient(to bottom, rgba(0,0,0,0.3), rgba(0,0,0,0.7))",
              }}
            />
          </div>

          {/* Main Content */}
          <Flex flexDirection="column" alignItems="center" justifyContent="center" height="100%">
            <motion.div initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ duration: 1 }}>
              <Heading fontSize={[5, 6, 7]} textAlign="center" zIndex={1}>
                Tomato Leaf Prediction
              </Heading>
            </motion.div>
            <motion.div initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ duration: 1.5 }}>
              <Subhead fontSize={[2, 3, 4]} textAlign="center" mt={3} zIndex={1}>
                Check If Your Plant is Healthy
              </Subhead>
            </motion.div>

            {/* Call to Action Buttons */}
            <Flex mt={4} justifyContent="center" zIndex={1}>
              <CallToAction
                bg="grey"
                mr={3}
                onClick={handleClick}
                style={{
                  boxShadow: "0px 4px 15px rgba(0, 0, 0, 0.2)",
                  transition: "transform 0.3s",
                }}
                onMouseEnter={(e) => (e.currentTarget.style.transform = "scale(1.05)")}
                onMouseLeave={(e) => (e.currentTarget.style.transform = "scale(1)")}
              >
                Start Now
              </CallToAction>
              <CallToAction
                bg="white"
                color="black"
                onClick={handleClick}
                style={{
                  boxShadow: "0px 4px 15px rgba(0, 0, 0, 0.2)",
                  transition: "transform 0.3s",
                }}
                onMouseEnter={(e) => (e.currentTarget.style.transform = "scale(1.05)")}
                onMouseLeave={(e) => (e.currentTarget.style.transform = "scale(1)")}
              >
                Learn More
              </CallToAction>
            </Flex>

            {/* Scroll Down Indicator */}
            <ScrollDownIndicator
              onClick={handleClick}
              mt={4}
              color="white"
              zIndex={1}
              style={{ cursor: "pointer", animation: "bounce 2s infinite" }}
            />
          </Flex>
        </Hero>
      </Provider>

      {/* Home Component */}
      <div ref={scrollToRef}>
        <Home />
      </div>
    </>
  );
};

export default Landing;
